public List<String> getKeys() throws IOException {
  List<String> list = new ArrayList<String>();
  List<Text> keys = credentials.getAllSecretKeys();
  for (Text key : keys) {
    if (key.find("@") == -1) {
      list.add(key.toString());
    }
  }
  return list;
}
